import logo from "./logo.svg";
import "./App.css";
import Container from "react-bootstrap/Container";
import Navbar from "react-bootstrap/Navbar";

function App() {
  return (
    <>
      <Navbar expand="lg" className="bg-body-tertiary">
        <Container>
          <Navbar.Brand>
            <span class="fw-bold">Blue</span>
            <span>Box</span>
          </Navbar.Brand>
        </Container>
      </Navbar>
      <Container></Container>
    </>
  );
}

export default App;
